import React, { Fragment } from "react";
import Link from "next/link";
import Navigation from "../components/navigation";

export default function _error() {
  return (
    <Fragment>
      <Navigation />
      <div
        style={{
          marginTop: "20rem",
          textAlign: "center",
        }}
      >
        <h1>The page does not exist</h1>
        <Link href="/">
          <a
            style={{
              display: "inline-block",
              padding: ".7rem 1.3rem",
              fontSize: "2.1rem",
              color: "#fff",
              background: "#6470FB",
              borderRadius: "5px",
            }}
            href="/"
          >
            Back to Home
          </a>
          <style jsx>{`
            h1 {
              font-size: 3rem;
            }
          `}</style>
        </Link>
      </div>
    </Fragment>
  );
}
